package com.human.ex;

public class If_If_else_else_If_switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=1;i<10;i++) {
			System.out.print(i);
		}
		System.out.print("\n");
		for(int i=5;i<10;i++) {
			System.out.print(i);
		}
		System.out.print("\n");
		for(int i=5;i<10;i++) {
			System.out.print(i);
		}
		System.out.print("\n");
		for(int i=5;i<10;i=i+2) {
			System.out.print(i);
		}
		System.out.print("\n");
	}

}
